import { Navigate, BrowserRouter as Router, Routes, Route} from "react-router-dom";

//style
import './App.css';

//components


//pages
import HomePage from "./pages/homepage";



function App() {
  return (
    <Router>
      <div>
      <Routes>
      <Route path="/" element={<HomePage/>} />
      </Routes>
      </div>
    </Router>
  );
}

export default App;
